// src/components/RightPanel.js
import React from 'react';

function RightPanel() {
  return (
    <div className="rightPanel">
      {/* Example “Media” section */}
      <div className="panelSection">
        <h3>Media</h3>
        <div className="mediaItem">screenshot.png</div>
        <div className="mediaItem">design_mockup.jpg</div>
      </div>

      {/* Example “Files” section */}
      <div className="panelSection">
        <h3>Files</h3>
        <div className="fileItem">proposal.docx</div>
        <div className="fileItem">resume.pdf</div>
      </div>
    </div>
  );
}

export default RightPanel;
